INSERT dbo.Articles
(
    ArticlesID, AuthorID, Title, Description, Article, PublishDate, ModifiedDate, URL, Comments, CreatedDate   )
VALUES
( 1, 1, 'What Counts For a DBA: Bravery',
'As a DBA, you have the opportunity to act like a firefighter. In fact the term ''fire-fighting'' is very often used to describe those tasks needed to find the root cause of a system outage because there are a lot of similarities.', 'As a DBA, you have the opportunity to act like a firefighter. In fact the term fire-fighting is very often used to describe those tasks needed to find the root cause of a system outage because there are a lot of similarities. When fighting a real fire there is more to it than the obvious need to rescue victims, you have to hunt for the cause before you can decide how to treat it. Sometimes water helps; sometimes, as with electrical fires, water makes it worse. Iteratively you work through the causes and treatments so that the fire is extinguished as quickly as possible without destroying more property and lives.
As a DBA, when we are fire-fighting, there is almost always some major catastrophe at the surface. The corporate database server is down that the customer website is based on, and there is no backup. Without this database working, everything is dead in the water. So one works tirelessly towards a solution, throwing all caution (and paperwork) to the wind and getting the revenue flow going again. This sort of bravery to face the unknown server gremlins impresses pretty much everyone you work with, especially the people who sign checks. Why, then, even worry about spending your days monitoring servers, backing up databases, and concerning yourself about data integrity at all. Having the bravery to work through a problem in a crisis is more rewarding.'
, '2013-04-13', NULL,
'https://www.red-gate.com/simple-talk/databases/sql-server/database-administration-sql-server/the-ten-commandments-of-sql-server-monitoring/',
7 , GETDATE()), 
( 2, 2, 'The Ten Commandments of SQL Server Monitoring',
'It is easy to get database monitoring wrong. There are several common-sense rules that can make all the difference between a monitoring system that works for you and helps to avoid database problems, and one that just creates a distraction. Adam Machanic spells out the rules, based on his considerable experience with database monitoring', 'Your SQL Server monitoring system should be an ally, another member of your team. It should work away in the background, offering a set of accurate, reliable alerts that inform the rest of the team when an important job fails, or fails to run, when resource usage shows sustained spikes or abnormal trends, when database or server properties deviate from the established standard. For each alert, you should be able to take meaningful, corrective action, meaning that you can respond quickly to an emergency, before too many people are affected, and that the overall quality of database systems demonstrably improves over time.
Having painted the idyllic picture of our monitoring systems, lets now admit the harsh reality that, for most of us, monitoring sucks. The problem is that most monitoring systems, custom-built or third party, are often: Over-configured  too many alerts, overwhelming the users with information Under-implemented  too few alerts provide enough useful information to pinpoint the problem quickly and take action It doesnt have to be like this. What follows are Ten Commandments that will make your monitoring solution work better, and allow you to get more sleep and have an easier time at work.' 
, '2013-04-13', NULL,'https://www.red-gate.com/simple-talk/databases/sql-server/database-administration-sql-server/the-ten-commandments-of-sql-server-monitoring/',
11 , GETDATE())
,
