( 4, 4, 'ASP.NET MVC: Annotated for Input',
'With an ASP.NET MVC application of any size, there comes a time when you are faced with creating utility forms where you don''t need a special form layout. One of the best ways of doing this is by using data annotations. Despite a quirk or two, it can save a lot of time.',  'foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar  foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar  foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar  foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar  foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar foo bar  '
, N'2013-02-18T00:00:00', N'2013-02-03T00:00:00', 'https://www.simple-talk.com/dotnet/asp.net', 15 , GETDATE())
