( 5, 5, 'SQL Server Statistics Questions We Were Too Shy to Ask', 
'If you need to optimise SQL Server performance, it pays to understand SQL Server Statistics. Grant Fritchey answers some frequently-asked questions about SQL Server Statistics: the ones we somehow feel silly asking in public, and think twice about doing so.',
'Try as I might, I find it hard to over-emphasize the importance of statistics to SQL Server. Bad or missing statistics leads to poor choices by the optimizer: The result is horrific performance. Recently, for example, I watched a query go from taking hours to taking seconds just because we got a good set of statistics on the data. The topic of statistics and their maintenance is not straightforward. Lots of questions occur to people when Im doing a presentation about statistics, and some get asked in front of the rest of the audience. Then there are other questions that get asked later on, in conversation. Here are some of those other questions.'
, '2013-04-13', NULL,'https://www.red-gate.com/simple-talk/databases/sql-server/performance-sql-server/sql-server-statistics-questions-we-were-too-shy-to-ask/', 23 , GETDATE())

